import React from 'react';
import { Image } from 'react-native';
import { useNavigation } from '@react-navigation/native'; // Import the necessary hook
import Onboarding from 'react-native-onboarding-swiper';

const MyOnboarding = () => {
  const navigation = useNavigation(); // Get the navigation object

  const handleDone = () => {
    // Navigate to the Home Page (replace 'HomePage' with the actual route name)
    navigation.navigate('HomePage');
  };

  return (
    <Onboarding
      titleStyles={{ color: 'blue' }}
      onDone={handleDone} // Call the handleDone function when the onboarding is done
      pages={[
        {
          backgroundColor: '#fff',
          image: <Image source={require('../LandingPage/burger.png')} style={{ width: 72, height: 72, resizeMode: 'contain' }} />,
          title: 'Onboarding',
          subtitle: 'Done with React Native Onboarding Swiper',
          titleStyles: { color: 'red' },
        },
        {
          backgroundColor: '#fe6e58',
          image: <Image source={require('../LandingPage/burger.png')} />,
          title: 'The Title',
          subtitle: 'This is the subtitle that supplements the title.',
        },
        {
          backgroundColor: '#999',
          image: <Image source={require('../LandingPage/burger.png')} />,
          title: 'Triangle',
          subtitle: "Beautiful, isn't it?",
        },
      ]}
    />
  );
};

export default MyOnboarding;
